import { Component } from "react";

class Remainder extends Component {
  state = { remainderList: [] };

  render() {
    return (
      <div className="bg-container">
        <h1 className="main-head">Remainder</h1>
        <div className="remainder-card-container">
          <div className="remainder-input-container">box1</div>
        </div>
        <div className="remainder-list-container">box2</div>
      </div>
    );
  }
}

export default Remainder;
